import React, { Component } from "react";
import authContext from "../adal/config";
const NavBar = props => {
  handleLogout = () => {
    authContext.logout();
  };
  return (
    <nav className="navbar navbar-light bg-light">
      <a className="navbar-brand" onClick={props.handleLogout}>
        Log out
      </a>
    </nav>
  );
};
export default NavBar;
